import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown, Form, FormControl, Button, Table } from 'react-bootstrap';
import logo from './images/applelogo.png';

class Menu extends React.Component {
    render() {
        return (
            <div className="welcome-nav">
                <header>
                    <Navbar expand="lg" variant="white" bg="black">
                        <Navbar.Brand href="#home"><img className="img-fluid" src={logo} alt="Logo" /></Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                                <Nav.Link href="#home">iPhone</Nav.Link>
                                <Nav.Link href="#link">MacBook Pro</Nav.Link>
                                <Nav.Link href="#link">Watch </Nav.Link>
                                <Nav.Link href="#link">Notify me</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Navbar>
                </header>
            </div>
        );
    }
}

export default Menu;
